configure:
  commands:
    end:
      new_state: execute
    hw-module breakout 29: "hw-module breakout 29\r\nBreakout: Enabling breakout ports\
      \ on Hu1/0/29 successful.\r\nSubports Created: Hu1/0/29/1 to Hu1/0/29/4\r\n\r\
      \n"
    line console 0:
      new_state: configure_line
    no logging console: ''
  prompt: Startek(config)#
configure_line:
  commands:
    end:
      new_state: execute
    exec-timeout 0: ''
  prompt: Startek(config-line)#
connect:
  commands:
    ? ''
    : new_state: execute
  preface: 'Trying mock_device ...

    Connected to mock_device.

    Escape character is ''^]''.'
  prompt: ''
execute:
  commands:
    config term:
      new_state: configure
    config-transaction:
      new_state: configure
    show version: ''
    term length 0: ''
    term width 0: ''
  prompt: Startek#
